    const getEmployerDetails = () => {
        fetch("api/getEmployer" + "?id=" + this.id).then(response =>
            response.json()
        ).then(data => {
            setEmployer({
                name: data.name,
                age: data.age,
                profilePhoto: data.profile_photo,
                description: data.description,
                email: data.email,
                createdAt: data.created_at,
            });
        });
    }

